const styles = {
    container: {
      padding: '2rem',
      display: 'flex',
      justifyContent: 'center',
    },
    mainPaper: {
      position: 'relative',
      width: '50%',
      backgroundColor: '#325636',
      padding: '2rem',
      display: 'flex',
      flexDirection: 'column'
    },
    text: {
      fontWeight: 'bold',
      color: '#FFFFFF',
      textAlign: 'left',
      margin: '0 0.5rem'
    },
    icon: {
      color: '#FFFFFF',
    },
    storeDetails: {
      display: 'flex',
      alignItems: 'center',
      marginTop: '1rem'
    },
    addressContainer: {
      display: 'flex',
      alignItems: 'center',
    },
    addressText: {
      fontWeight: 'normal', // Remove bold weight for the address text
      color: '#FFFFFF',
      marginLeft: '0.5rem', // Adjust margin as needed
    }
  };
  
  const PickupPage = () => {
    return (
      <div style={styles.container}>
        <Paper elevation={3} sx={styles.mainPaper}>
          <Typography variant='h6' style={styles.text}>Store details</Typography>
          <div style={styles.storeDetails}>
            <StorefrontOutlinedIcon style={styles.icon} />
            <Typography style={styles.text}>Relaxing Koala</Typography>
          </div>
          <div style={styles.addressContainer}>
            <Typography style={styles.addressText}>Shop 2, Glenferrie Road, 3122, VIC</Typography>
          </div>
        </Paper>
      </div>
    );
  };
  
  export default PickupPage;
